// Pastikan untuk menambahkan routing dinamis di `ProjectRoutes.js` atau file routing lain
import React from "react";
import { useRoutes } from "react-router-dom";
import Home from './pages/Home';
import NotFound from "./pages/NotFound";
import RelatedProductsSection from "./pages/RelatedProductsSection"; // Halaman overview atau related products

const ProjectRoutes = () => {
  let element = useRoutes([
    { path: "/", element: <Home /> },
    { path: "*", element: <NotFound /> },
    { path: "related-products/:productId", element: <RelatedProductsSection /> }, // Tambahkan rute dinamis
  ]);

  return element;
};

export default ProjectRoutes;
